// UniformPro Font f√ºr jsPDF
// Automatisch generiert aus OTF-Dateien

const UNIFORMPRO_REG_BASE64 = "";

const UNIFORMPRO_BLD_BASE64 = "";

// Fonts bei jsPDF registrieren (wird beim ersten doc-Aufruf ausgef√ºhrt)
if (typeof window !== "undefined" && window.jspdf) {
  const jsPDF = window.jspdf.jsPDF;
  const callAddFont = function() {
    this.addFileToVFS("UniformProCon-Reg.otf", UNIFORMPRO_REG_BASE64);
    this.addFont("UniformProCon-Reg.otf", "UniformPro", "normal");
    this.addFileToVFS("UniformProCon-Bld.otf", UNIFORMPRO_BLD_BASE64);
    this.addFont("UniformProCon-Bld.otf", "UniformPro", "bold");
  };
  jsPDF.API.events.push(["addFonts", callAddFont]);
}
